import React from "react";
import { users } from "../../data/data";
const Table = ({ data }) => {
  return (
    <div className="pnl convex-1">
      {users.map((x) => {
        return (
          <div className="row no-gutters">
            <div className="col-auto"></div>
          </div>
        );
      })}
    </div>
  );
};

export default Table;
